import { userInfo } from 'os';
import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { Link } from "react-router-dom"

const Login = () => {
    
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    

    const handleSubmit = (e) => {
        e.preventDefault()
        const check = userInfo.find()
        const info = {email, password}
        checkUser()

        fetch('http://localhost:3333/login/', {
            mode: 'no-cors',
            method: 'POST',
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(info)
        }).then(() => {
            console.log("Login")
            console.log(info)

        })

    }

    const checkUser = () => {
        const check = userInfo.find(user => {user.email === email && user.password === info.password})
        if(check) {
            console.log("login")
        } else {
            console.log("no")
        }
    }
    return ( 

        <div className="all ">

        <div className='button d-flex justify-content-center '>
        <Link to="/" className="text-center btn btn-secondary btn-lg m-4">Login</Link>
        <Link to="/register" className="text-center btn btn-secondary btn-lg m-4">Register</Link>
        </div>
                
            <p className='text-center'>Sign With:</p>
        
        <div className="container d-flex justify-content-center">
            
        <Form onSubmit={handleSubmit}>
            <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" value = {email} onChange={(e) => setEmail (e.target.value)} placeholder="Enter email" required/>
            <Form.Text className="text-muted">
          We'll never share your email with anyone else.
            </Form.Text>
        </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control type="password" value = {password} onChange={e => setPassword(e.target.value)} placeholder="Password" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicCheckbox">
        <Form.Check type="checkbox" label="Check me out" />
      </Form.Group>
      <Button variant="primary" type="submit">
        Submit
      </Button>
    </Form>
        </div>
            </div>
     );
}
 
export default Login;
